package Loop;

public class continue_loop {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for (int j=0; j<=6; j++)
		{
	           if (j==4)
	        	  
	           {
		      continue;
		   }
	           //value of 4 will not printed
	           System.out.print(j+" ");
		}
	}

}
